{{RawHtml|phab=T294760}}

Syntax example used in the help section "link" of the toolbar

www.example.org is not a real website, but it has been reserved for use in software documentation. If you translate the word example and try to go to that web address, then you might get a message that it doesn't exist. But somebody may have created a commercial web page for that address, such as www.Beispiel.org, using the German word for example. It is therefore recommended that you do not translate http://www.example.org at all. If you do wish to translate it you should first check where the translated link takes you.

